    SNICKERS.compareUniqueJobs = function(job,jobs){
        for(var i = 0 ; i < jobs.length;i++) {
            if(jobs[i].id == job.id) {
                if(job.silver && !jobs[i].silver || (job.silver == jobs[i].silver &&job.distance < jobs[i].distance)) {
                    jobs.splice(i,1);
                    jobs.push(job);
                }
                return;
            }
        }
        jobs.push(job);
    };
    SNICKERS.findJobData = function(job) {
        for(var i = 0 ; i < JobsModel.Jobs.length;i++) {
            if(JobsModel.Jobs[i].id == job.id) {
                return JobsModel.Jobs[i];
            }
        }
    };
    SNICKERS.parseJobData = function(jobs) {
        for(var job = 0 ; job < jobs.length;job++) {
            var currentJob = jobs[job];
            var data = SNICKERS.findJobData(currentJob);
            var xp = data.basis.short.experience;
            var money = data.basis.short.money;
            currentJob.setMotivation(data.jobmotivation*100);
            if(currentJob.silver) {
                xp = Math.ceil(1.5*xp);
                money = Math.ceil(1.5*money);
            }
            currentJob.setExperience(xp);
            currentJob.setMoney(money);
        }
    };
    SNICKERS.updateJobDistances = function() {
        for(var i = 0; i < SNICKERS.allJobs.length;i++) {
            SNICKERS.allJobs[i].calculateDistance();
        }
    };
    SNICKERS.getAllUniqueJobs = function() {
        SNICKERS.updateJobDistances();
        var jobs = [];
        for(var i = 0 ; i < SNICKERS.allJobs.length;i++) {
            var currentJob = SNICKERS.allJobs[i];
            if(SNICKERS.jobFilter.filterJob != "") {
                if(!SNICKERS.getJobName(currentJob.id).toLowerCase().includes(SNICKERS.jobFilter.filterJob)) {
                    continue;
                }
            }
            
            if(SNICKERS.checkIfJobAdded(currentJob.id)) {
                continue;
            }
            var isSilver = SNICKERS.checkIfSilver(currentJob.x,currentJob.y,currentJob.id);
            currentJob.silver = isSilver;
            currentJob.calculateDistance();
            if(isSilver && SNICKERS.jobFilter.filterNoSilver) {
                continue;
            }
            if(!isSilver && SNICKERS.jobFilter.filterOnlySilver) {
                continue;
            }
            if(SNICKERS.jobFilter.filterCenterJobs && currentJob.id < 131 ) {
                continue;
            }
            SNICKERS.compareUniqueJobs(currentJob,jobs);
        }
        SNICKERS.parseJobData(jobs);

        var experienceSort = function(a,b) {
              if(a == null && b == null) {
                  return 0;
              }
              if(a == null && b != null) {
                  return 1;
              }
              if(a != null && b == null) {
                  return -1;
              }
              var a1 = a.experience;
              var b1 = b.experience;
              return (a1 > b1) ? -1 :(a1 < b1) ? 1 :0;
          };
          var reverseExperienceSort = function(a,b) {
              if(a == null && b == null) {
                  return 0;
                 }
              if(a == null && b != null) {
                  return -1;
              }
              if(a != null && b == null) {
                  return 1;
              }
              var a1 = a.experience;
              var b1 = b.experience;
              return (a1 > b1) ? 1 :(a1 < b1) ? -1 :0;
          };
        var distanceSort = function(a,b) {
              if(a == null && b == null) {
                  return 0;
              }
              if(a == null && b != null) {
                  return 1;
              }
              if(a != null && b == null) {
                  return -1;
              }
              var a1 = a.distance;
              var b1 = b.distance;
              return (a1 > b1) ? -1 :(a1 < b1) ? 1 :0;
          };
           var reverseDistanceSort = function(a,b) {
             if(a == null && b == null) {
                  return 0;
                 }
              if(a == null && b != null) {
                  return -1;
              }
              if(a != null && b == null) {
                  return 1;
              }
              var a1 = a.distance;
              var b1 = b.distance;
              return (a1 > b1) ? 1 :(a1 < b1) ? -1 :0;
          };
        if(SNICKERS.sortJobTableXp == 1) {
            jobs.sort(experienceSort);
        }
        if(SNICKERS.sortJobTableXp == -1) {
            jobs.sort(reverseExperienceSort);
        }
        if(SNICKERS.sortJobTableDistance == 1) {
            jobs.sort(distanceSort);
        }
        if(SNICKERS.sortJobTableDistance == -1) {
            jobs.sort(reverseDistanceSort);
        }
        return jobs;
    };
