    SNICKERS.CheckIfConsumableAdded = function(item) {
        if(item == undefined)
            return true;
        for(var i = 0 ; i < SNICKERS.allConsumables.length;i++) {
            if(SNICKERS.allConsumables[i].id == item.obj.item_id) {
                return true;
            }
        }
        return false;
    };
    SNICKERS.addConsumable = function(item) {
        if(SNICKERS.CheckIfConsumableAdded(item)) {
            return;
        }
        var consumable = new ConsumablePrototype(item.obj.item_id,item.obj.image,item.obj.name);
        var bonuses = SNICKERS.parseConsumableBonuses(item.obj.usebonus);
        if(bonuses[0] == 0 && bonuses[1] == 0 && bonuses[2] == 0)
        return;
        consumable.setEnergy(bonuses[0]);
        consumable.setMotivation(bonuses[1]);
        consumable.setHealth(bonuses[2]);
        consumable.setCount(item.count);
        SNICKERS.allConsumables.push(consumable);
    };
    SNICKERS.removeConsumable = function(item) {
        var index;
        for(var i = 0 ; i < SNICKERS.allConsumables.length;i++) {
            if(SNICKERS.allConsumables[i].id == item.id) {
                index = i;
                break;
            }
        }
        if(index != undefined) {
            if(SNICKERS.allConsumables[index].count > 1) {
                SNICKERS.allConsumables[index].count--;
            }else {
                SNICKERS.allConsumables.slice(index,1);
            }
        }
    };
    SNICKERS.parseConsumableBonuses = function(bonuses) {
        var getBonus = function(text,type) {
            switch(type) {
                case 0:
                    text = text.replace(SNICKERS.searchKeys[SNICKERS.language].energyText,"");
                    break;
                case 1:
                    text = text.replace(SNICKERS.searchKeys[SNICKERS.language].motivationText,"")
                    break;
                case 2:
                    text = text.replace(SNICKERS.searchKeys[SNICKERS.language].healthText,"");
                    break;
            }
            text = text.slice(1);
            text = text.replace("%","");
            return parseInt(text);
        }
        var result = Array(3).fill(0);
        for(var i = 0 ; i < bonuses.length;i++) {
            var type = -1;
            if(bonuses[i].includes(SNICKERS.searchKeys[SNICKERS.language].energyText)) {
                type = 0;
            }else if(bonuses[i].includes(SNICKERS.searchKeys[SNICKERS.language].motivationText)) {
                type = 1;
            }else if(bonuses[i].includes(SNICKERS.searchKeys[SNICKERS.language].healthText)) {
                type = 2;
            }
            if(type !=-1)
            result[type] = getBonus(bonuses[i],type);

        }
        return result;
    };
    SNICKERS.filterConsumables = function(energy,motivation,health) {
        var result = [];
        for(var i = 0 ; i < SNICKERS.allConsumables.length;i++) {
            if(energy && SNICKERS.allConsumables[i].energy == 0) {
                continue;
            }
            if(motivation && SNICKERS.allConsumables[i].motivation == 0) {
                continue;
            }
            if(health && SNICKERS.allConsumables[i].health == 0) {
                continue;
            }
            result.push(SNICKERS.allConsumables[i]);
        }
        return result;
    };
