    SNICKERS.useConsumable = async function(itemToUse) {
        var item = Bag.getItemByItemId(itemToUse.id);
        item.showCooldown();
        SNICKERS.currentState = 2;
        SNICKERS.selectTab("choosenJobs");
        while(true) {
            if(SNICKERS.canUseConsume(itemToUse)) {
                if(SNICKERS.healthSet != -1) {
                    SNICKERS.equipSet(SNICKERS.healthSet);
                    await new Promise(r => setTimeout(r, SNICKERS.settings.setWearDelay*1000));
                }
                SNICKERS.removeConsumable(itemToUse);
                SNICKERS.consumableUsed.push(itemToUse);
                ItemUse.doIt(itemToUse.id);
                break;
            }
            await new Promise(r => setTimeout(r, 1));
        }
        while(true) {
            if(!SNICKERS.canUseConsume(itemToUse)) {
                $(".tw2gui_dialog_framefix").remove();
                break;
            }
            await new Promise(r => setTimeout(r, 1));
        }
        SNICKERS.run();
    };
    SNICKERS.findProperConsumable = function(motivationMissing,energyMissing,healthMissing,averageMotivationMissing,consumables) {
        var betterEnergy = function(item1,item2) {
            var distanceItem1 = Math.abs(energyMissing - item1.energy);
            var distanceItem2 = Math.abs(energyMissing - item2.energy);
            return (distanceItem1 < distanceItem2 ) ? -1 :(distanceItem1 > distanceItem2) ? 1 : 0;
        };
        var betterMotivation = function(item1,item2) {
            var distanceItem1 = Math.abs(averageMotivationMissing - item1.motivation);
            var distanceItem2 = Math.abs(averageMotivationMissing - item2.motivation);
            return (distanceItem2 < distanceItem1) ? item2 : item1;
        };
        var findMotivationConsume = function(consumes) {
            var consumeToChoose = null;
            for(var i = 0 ; i < consumes.length;i++) {
                if(consumeToChoose == null && consumes[i].motivation != 0) {
                    consumeToChoose = consumes[i];
                    continue;
                }
                if(consumeToChoose != null && consumes[i].motivation != 0) {
                    consumeToChoose = betterMotivation(consumeToChoose,consumables[i]);
                }
            }
            return consumeToChoose;
        };
        var findHealthConsume = function(consumes) {
            for(var i = 0 ; i < consumes.length;i++) {
                if(consumes[i].health != 0) {
                    return consumes[i];
                }
            }
            return null;
        };
        if(consumables.length  == 0) return null;
        var consums = consumables;
        consums = consums.sort(betterEnergy);
        if(energyMissing == 100) {
            return consums[0];
        }
        if(motivationMissing == SNICKERS.addedJobs.length) {
            return findMotivationConsume(consums);
        }
        if(SNICKERS.isHealthBelowLimit()) {
            return findHealthConsume(consums);
        }
    };
    SNICKERS.tryUseConsumable = function(result) {
        var healthMissing = 100 - (Character.health/Character.maxHealth) * 100;
        var energyMissing = 100 - (Character.energy/Character.maxEnergy) * 100;
        var motivationMissing = SNICKERS.jobsBelowMotivation(result);
        var consumables = SNICKERS.allConsumables;
        var averageMotivationMissing = SNICKERS.averageMissingMotivation(result);
        var selectedConsumes = [];
        for(var i = 0 ; i < consumables.length;i++) {
            if(consumables[i].selected)
                selectedConsumes.push(consumables[i]);
        }
        var itemToUse = SNICKERS.findProperConsumable(motivationMissing,energyMissing,healthMissing,averageMotivationMissing,selectedConsumes);
        if(itemToUse == null) return false;
        SNICKERS.useConsumable(itemToUse);
        return true;
    };
    SNICKERS.calculateDistances = function() {
        for(var i = 0; i < SNICKERS.addedJobs.length;i++) {
            SNICKERS.addedJobs[i].calculateDistance();
        }
    };
    SNICKERS.createDistanceMatrix = function() {
        var distances = new Array(SNICKERS.addedJobs.length);
        for(var i = 0 ; i < distances.length;i++) {
            distances[i] = new Array(SNICKERS.addedJobs.length);
        }
        for(var i = 0 ; i < distances.length;i++) {
            for(var j = i; j < distances[i].length;j++) {
                if(i == j) {
                    distances[i][j] = distances[j][i] = Number.MAX_SAFE_INTEGER;
                    continue;
                }
                distances[i][j] = distances[j][i] = GameMap.calcWayTime({x:SNICKERS.addedJobs[i].x,y:SNICKERS.addedJobs[i].y},{x:SNICKERS.addedJobs[j].x,y:SNICKERS.addedJobs[j].y});
            }
        }
        return distances;
    };
    SNICKERS.createRoute = function() {
        SNICKERS.currentJob = {job:0,direction:true}
        SNICKERS.calculateDistances();
        var closestJobIndex = 0;
        var closestDistance = SNICKERS.addedJobs[0].distance;
        var route = [];
        var distances = SNICKERS.createDistanceMatrix();
        var getClosestJob = function(index,route,distances) {
            var closestDistance = Number.MAX_SAFE_INTEGER;
            var closestIndex = -1;
            for(var i = 0 ; i < distances.length;i++) {
                if(index == i || route.includes(i)) {
                    continue;
                }
                if(distances[i][index] < closestDistance) {
                    closestDistance = distances[i][index];
                    closestIndex = i;
                }
            }
            return closestIndex;
        };
        for(var i = 1; i < SNICKERS.addedJobs.length;i++) {
            if(SNICKERS.addedJobs[i].distance < closestDistance) {
                closestDistance = SNICKERS.addedJobs[i].distance;
                closestJobIndex = i;
            }
        }
        route.push(closestJobIndex);
        while(route.length < SNICKERS.addedJobs.length) {
            var closestJob = getClosestJob(route[route.length-1],route,distances);
            route.push(closestJob);
        }
        var addedJobsOrder = [];
        for(var i = 0 ; i < route.length;i++) {
            addedJobsOrder.push(SNICKERS.addedJobs[route[i]]);
        }
        SNICKERS.addedJobs = addedJobsOrder;
        SNICKERS.selectTab("choosenJobs");
    };
