    SNICKERS.checkMotivation = function(index,result,callback) {
        var check = function(index,result) {
            SNICKERS.loadJobMotivation(index,function(motivation) {
            result.push(motivation);
             if(index+1 < SNICKERS.addedJobs.length ) {
                 check(++index,result);
             }else
             if(index+1 == SNICKERS.addedJobs.length) {
                 callback(result);
                 return;
             }
         });
        };
        check(0,result);
    };
    SNICKERS.isMotivationAbove = function(result) {
        for(var i = 0 ; i < result.length;i++) {
            if(result[i] > SNICKERS.addedJobs[i].stopMotivation) {
                return true;
            }
        }
        return false;
    };
    SNICKERS.getBackToJobAfterMotivationStop = function() {

    };
    SNICKERS.jobsBelowMotivation = function(result) {
        var count = 0;
        for(var i = 0 ; i < result.length;i++) {
            if(result[i] <= SNICKERS.addedJobs[i].stopMotivation) {
                count++;
            }
        }
        return count;
    };
    SNICKERS.averageMissingMotivation = function(result) {
        var motivation = 0;
        for(var i = 0 ; i < result.length;i++) {
            motivation += (100-result[i]);
        }
        return motivation/result.length;
    };
    SNICKERS.isHealthBelowLimit = function() {
        if(SNICKERS.settings.healthStop >= ((Character.health/Character.maxHealth) * 100)) {
            return true;
        }
        return false;
    };
    SNICKERS.isStopMotivationZero = function() {
        for(var i = 0 ; i < SNICKERS.addedJobs.length;i++) {
            if(SNICKERS.addedJobs[i].stopMotivation == 0) {
                return true;
            }
        }
        return false;
    };
    SNICKERS.canAddMissing = function(result) {
        if(!SNICKERS.settings.addMotivation && SNICKERS.jobsBelowMotivation(result) && !SNICKERS.isStopMotivationZero()) {
            alert("Can't continue because of motivation");
            return false;
        }
        if(!SNICKERS.settings.addEnergy && Character.energy == 0) {
            alert("Can't continue because of energy");
            return false;
        }
        if(!SNICKERS.settings.addHealth && SNICKERS.isHealthBelowLimit()) {
            alert("Can't continue because of health");
            return false;
        }
        return true;
    };
    SNICKERS.finishRun = function() {
        SNICKERS.currentState = 0;
        SNICKERS.isRunning = false;
        SNICKERS.selectTab("choosenJobs");
        alert("Finished");
    };
    SNICKERS.updateStatistics = function(oldXp) {
        var xpDifference = Character.experience - oldXp;
        SNICKERS.statistics.xpInSession += xpDifference;
        SNICKERS.statistics.totalXp += xpDifference;
    }
    SNICKERS.run = function() {
        SNICKERS.checkMotivation(0,[],function(result) {
            if((SNICKERS.isMotivationAbove(result) || SNICKERS.isStopMotivationZero()) && Character.energy > 0 && !SNICKERS.isHealthBelowLimit()){
                SNICKERS.currentState = 1;
                SNICKERS.selectTab("choosenJobs");
                SNICKERS.prepareJobRun(SNICKERS.currentJob.job);
            }else {
                if(!SNICKERS.canAddMissing(result)) {
                    SNICKERS.finishRun();
                }else {
                    var answer = SNICKERS.tryUseConsumable(result);
                    if(!answer) {
                        SNICKERS.finishRun();
                    }
                }
            }
        });
    };
    SNICKERS.prepareJobRun = function(index) {
        setTimeout(function() {
            SNICKERS.loadJobMotivation(index,async function(motivation) {
                if(Character.energy == 0 || SNICKERS.isHealthBelowLimit()) {
                    SNICKERS.run();
                }
                else if(motivation <= SNICKERS.addedJobs[index].stopMotivation && SNICKERS.addedJobs[index].stopMotivation > 0) {
                    SNICKERS.checkMotivation(0,[],function(result) {
                        if(SNICKERS.isMotivationAbove(result)) {
                            SNICKERS.changeJob();
                        }else {
                            SNICKERS.run();
                        }
                    });
                }else
                if(GameMap.calcWayTime(Character.position,{x:SNICKERS.addedJobs[index].x,y:SNICKERS.addedJobs[index].y}) == 0) {
                    var maxJobs;
                    (Premium.hasBonus('automation')) ? maxJobs = 9 : maxJobs = 4;
                    if(SNICKERS.addedJobs[index].stopMotivation != 0){
                    var numberOfJobs = Math.min(Math.min(motivation - SNICKERS.addedJobs[index].stopMotivation,Character.energy),maxJobs);
                    }else {
                        var numberOfJobs = Math.min(Character.energy,maxJobs);
                    }
                    SNICKERS.runJob(index,numberOfJobs);
                }else {
                    var equiped = await SNICKERS.equipSet(SNICKERS.travelSet);
                    SNICKERS.walkToJob(index);
                }
            });
        },SNICKERS.generateRandomNumber(SNICKERS.settings.jobDelayMin,SNICKERS.settings.jobDelayMax)*1000);
    };
    SNICKERS.walkToJob = async function(index) {
        JobWindow.startJob(SNICKERS.addedJobs[index].id,SNICKERS.addedJobs[index].x,SNICKERS.addedJobs[index].y,15);
        while(true) {
            if(GameMap.calcWayTime(Character.position,{x:SNICKERS.addedJobs[index].x,y:SNICKERS.addedJobs[index].y}) == 0) {
                break;
            }
            if(!SNICKERS.isRunning) {
                break;
            }
            await new Promise(r => setTimeout(r, 1));
        }
        SNICKERS.cancelJobs();
        if(SNICKERS.isRunning)
        SNICKERS.prepareJobRun(index);
    };
