    var buttonApply = new west.gui.Button("Apply", function() {
        SNICKERS.settings.addEnergy = checkboxAddEnergy.isSelected();
        SNICKERS.settings.addMotivation = checkboxAddMotivation.isSelected();
        SNICKERS.settings.addHealth = checkboxAddHealth.isSelected();
        SNICKERS.settings.useBestGear = checkboxUseBestGear.isSelected(); // Apply new setting
        if (SNICKERS.isNumber(healthStopTextfiled.getValue())) {
            var healthStop = parseInt(healthStopTextfiled.getValue());
            healthStop = Math.min(30, healthStop);
            SNICKERS.settings.healthStop = healthStop;
        }
        if (SNICKERS.isNumber(setWearDelayTextfiled.getValue())) {
            var setWearDelay = parseInt(setWearDelayTextfiled.getValue());
            setWearDelay = Math.min(10, setWearDelay);
            SNICKERS.settings.setWearDelay = setWearDelay;
        }
        if (SNICKERS.isNumber(jobDelayTextFieldMin.getValue())) {
            var jobDelayTimeMin = parseInt(jobDelayTextFieldMin.getValue());
            SNICKERS.settings.jobDelayMin = jobDelayTimeMin;
        } else {
            SNICKERS.settings.jobDelayMin = 0;
            SNICKERS.settings.jobDelayMax = 0;
            new UserMessage("Wrong format of delay job min value. Please set a number.", UserMessage.TYPE_ERROR).show();
        }
        if (SNICKERS.isNumber(jobDelayTextFieldMax.getValue())) {
            var jobDelayTimeMax = parseInt(jobDelayTextFieldMax.getValue());
            SNICKERS.settings.jobDelayMax = jobDelayTimeMax;
        } else {
            SNICKERS.settings.jobDelayMin = 0;
            SNICKERS.settings.jobDelayMax = 0;
            new UserMessage("Wrong format of delay job max value. Please set a number.", UserMessage.TYPE_ERROR).show();
        }
        SNICKERS.selectTab("settings");
    })

